import React from 'react';
import {Show, SimpleShowLayout, TextField, DateTimeField, ImageField, ArrayField, SimpleFormIterator} from 'react-admin';

const PhotoShow = (props) => {
    return (
        <Show {...props}>
            <SimpleShowLayout>
                <TextField source='id' />
                <TextField source='title' />
                <TextField source='description' />
                <ImageField source='ownImage'/>
                <TextField label = 'Owner' source='ownerID.email'/>
                <DateTimeField label = 'Uploaded at' source='upload'/>
                <ArrayField source='comment'>
                    <SimpleFormIterator>
                        <TextField source='user.email'/>
                        <TextField source='text'/>
                    </SimpleFormIterator>
                </ArrayField>
            </SimpleShowLayout>
        </Show>
    )
};

export default PhotoShow;
